<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title></title>
    <style>
        body,
        html {
            height: 100%;
            margin: 0;
            display: flex;
            align-items: center;
            justify-content: center;
            flex-direction: column;
        }

        .gradient-background {
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            z-index: -1;
            background-size: 200% 200%;
            animation: gradientTransition 10s ease infinite;
            background-image: linear-gradient(135deg, #96f5a3, #96f5a3);
        }

        #changeButton {
            padding: 15px 30px;
            font-size: 18px;
            border: none;
            border-radius: 10px;
            color: white;
            background-color: #77b842;
            cursor: pointer;
            position: relative;
            bottom: -20%;
            transition: background-color 0.3s, transform 0.3s;
        }

        #changeButton:active {
            background-color: #00C000;
            transform: scale(0.95);
        }
    </style>
</head>
